import { Component } from '@angular/core';
import { EventserviceService } from 'src/app/eventbackoffice/serviceseventback/eventservice.service';
import { Router } from '@angular/router';
import { ActivatedRoute } from '@angular/router';
import { FeedbackService } from 'src/app/eventbackoffice/serviceseventback/feedback.service';
import { myevent } from 'src/app/event';
import { feedback } from 'src/app/feedback';

@Component({
  selector: 'app-feedbackeventb',
  templateUrl: './feedbackeventb.component.html',
  styleUrls: ['./feedbackeventb.component.css']
})
export class FeedbackeventbComponent {
  eventId!: number;
  feedbackevent?: myevent;
  feedback: feedback = {
    comment: '',
    eventRating: 0,
    event: undefined,
  };

  constructor(private route: ActivatedRoute, private router: Router , private eventService: EventserviceService, private feedbackService: FeedbackService
  ) {}

  ngOnInit(): void {
    this.eventId = Number(this.route.snapshot.paramMap.get('id'));
    this.eventService.getEvent(this.eventId).subscribe((event) => {
      this.feedbackevent = event;
      this.feedback.event = event;
    });
  }

  submitFeedback(): void {
    console.log('Feedback submitted:', this.feedback);
    const userId = 1

    this.feedbackService.addEventFeedback(userId , this.eventId,this.feedback).subscribe(() => {
      alert('Feedback submitted!');
      this.router.navigate(['/event']);

    });
  }

}
<div class="container mt-4">
  <div class="row justify-content-center">
    <div class="col-md-6 col-lg-5">
      <div class="card custom-card shadow-sm h-100">
        <img [src]="feedbackevent?.posterURL" class="card-img-top" alt="Event Poster" />
        <div class="card-body d-flex flex-column align-items-center text-center">
          <h5 class="card-title event-name"><strong>{{ feedbackevent?.eventName }}</strong></h5>
          <p class="card-text event-text">{{ feedbackevent?.eventDescription }}</p>
          <p class="card-text event-text"><strong>Location:</strong> {{ feedbackevent?.location }}</p>
          <p class="card-text event-text"><strong>Type:</strong> {{ feedbackevent?.eventType }}</p>
          <p class="card-text event-text">
            <strong>Starts:</strong> {{ feedbackevent?.eventStartDate }}<br />
            <strong>Ends:</strong> {{ feedbackevent?.eventEndDate }}
          </p>
          <p class="card-text event-text">
            <strong>Max Participants:</strong> {{ feedbackevent?.maxParticipants }}<br />
            <strong>Register By:</strong> {{ feedbackevent?.registrationEndDate }}
          </p>
        </div>
      </div>
    </div>
  </div>

  <div class="row justify-content-center mt-4">
    <div class="col-md-6 col-lg-5 feedback-box">
      <h5 class="text-center">💬 Leave Your Feedback</h5>
      <textarea [(ngModel)]="feedback.comment" class="form-control feedback-textarea" placeholder="Write your comment..." rows="4"></textarea>
      <br />
      <label class="rating-label">⭐ Rating (0 to 5):</label>
      <input type="number" [(ngModel)]="feedback.eventRating" class="form-control rating-input" min="0" max="5" />
      <br />
      <div class="d-flex justify-content-center">
        <button class="btn submit-feedback-btn" (click)="submitFeedback()">Send Feedback</button>
      </div>
    </div>
  </div>
</div>
